import React from 'react';
import Card from './Card';


const CardList = ({ robots }) => {
  let robot = robots[0];

  return (
    <div>
      <Card id={ robot.id } name={ robot.name } email={ robot.email } username={ robot.username }/>
    </div>
  );
}

export default CardList;
